import React from 'react';
import '../../App.css';
import Footer from '../Footer';
import './Pages.css';
import '../ProjectSections.css'


function Projects() {
    return (
        <>
          <div className="page-content">
          <Section
            title="May 2021 - present"
            style="SwiftXCode"
          >
            <h3 class="bolded-title same-line">Carnegie Mellon University  </h3><h4 class="faded-title same-line"> B.S. in Information Systems</h4>
            <ul>
              <p>The 30-Day Adulting Challenge app is an iOS application developed at the Connected Experience HCI Lab at CMU. Using social influence principles, this app aims to effectively teach and encourage cybersecurity habits to young adults. As the head developer on the team, I collaborate with designers and other researchers to develop an application that will be first used to test our research questions and eventually be deployed to the app store for public use. Additionally, I help with talk alouds and intermediate user studies to gain insights and early feedback.</p>
            </ul>
          </Section>
          </div>
        </>
    );
}

export default Projects;
